class Header extends Component { 
    constructor(){
        super()
        this.state.styling = {
          padding:"30px",
          border:"3px solid black",
        }
    }
    render(){
      return (
          <header style={this.state.styling}>
              
          </header>
      );
    }
}

export default Header;
